import React from 'react';
import ReactDOM  from 'react-dom';
import './App.css'; 

const Title = () => (
  <a href='/'>
    <h1>Food Villa</h1>
  </a>
);
const HeaderComponent = () => {
  return(
    <div className='header'>
      <Title/>
      <div className='navitems'>
        <ul>
          <li>Home</li>
          <li>About</li>
          <li>Contact Us</li>
          <li>Cart</li>
        </ul>
      </div>
    </div>
  );
};

const ResturantCard = () =>{
  return(
    <div className='card'>
      <img src='https://www.google.com/url?sa=i&url=https%3A%2F%2Frecipes.timesofindia.com%2Frecipes%2Fkaju-katli%2Frs55048826.cms&psig=AOvVaw0GGHq7abPB9Um8Rq1SONoX&ust=1684170393372000&source=images&cd=vfe&ved=0CBEQjRxqFwoTCKjzh-Kl9f4CFQAAAAAdAAAAABAE'/>
      <h2>Kaju Katli</h2>
      <h3>Sweet, Indian</h3>
      <h4>4.2 stars</h4>
    </div>
  );
}
const Body =() =>{
  return(
<div>
  <ResturantCard/>
</div>
  )
}
const Footer =() =>{
  return(
    <h1>Footer</h1>
  )
}
const Applayout = ()=>{
  return(
    <>
    <HeaderComponent/>
     <Body/>
     <Footer/>
      </>
  );
}


const root = ReactDOM.createRoot(document.getElementById('root'));
root.render(<Applayout/>);
